import './App.css';
import React, { useEffect } from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css';
import Pricing from './components/Pricing';
function Main() {
  const scrollToPricingSection = () => {
    const pricingSection = document.getElementById('pricing-section');
    pricingSection.scrollIntoView({ behavior: 'smooth' });
  };
  useEffect(() => {
    AOS.init({
      duration: 500,
      once: true,
    });
  }, []);
  return (
    <section className="flex flex-col items-start justify-start w-[80vw] h-screen mt-24 text-white gap-4">
        <h1 className='font-bold text-7xl' data-aos="fade-up">LC MONEDAS</h1>
        <p className='text-lg font-thin' data-aos="fade-up" data-aos-delay="200">Seguro, confiable y r√°pido.</p>
        <h2 className='text-lg font-bold' data-aos="fade-up" data-aos-delay="300">+11.000 personas confian en nosotros.</h2>
        <button className='px-4 py-2 text-xl transition-all duration-150 bg-indigo-600 rounded-lg cursor-pointer font-regular hover:scale-110 bg-opacity-40'
         onClick={scrollToPricingSection}
        >Ver Precios</button>
    </section>
  );
}

export default Main;
